import '../styles/Cartelera.css';
import { FaUserCircle } from 'react-icons/fa';

function Cartelera() {
  return (
    <div className="cartelera-container">
      <header className="cartelera-header">
        <h1>Esta es nuestra cartelera</h1>
        <div className="cartelera-actions">
          <button className="btn-comprar">Comprar boleto</button>
          <div className="user-menu">
            <FaUserCircle className="user-icon" />
            <div className="logout-card">Cerrar sesión</div>
          </div>
        </div>
      </header>

      <section className="peliculas-grid">
        {/* Ejemplo de tarjeta de película */}
        <div className="pelicula-card">
          <img src="https://via.placeholder.com/200x300" alt="Poster" />
          <div className="pelicula-info">
            <h3>Título de película</h3>
            <p>Descripción de ejemplo que viene desde la base de datos.</p>
          </div>
        </div>
        {/* Podés repetir esta tarjeta con .map más adelante */}
      </section>
    </div>
  );
}

export default Cartelera;
